import React from 'react';

const styles = {
  container: {
    textAlign: 'center',
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
    color: 'white',
    backgroundImage: 'url("/1.jpg")',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    minHeight: '100vh',
    paddingTop: '80px', // Add padding to account for the fixed header
  },
  header: {
    position: 'fixed', // Make the header fixed
    top: 0,
    left: 0,
    right: 0,
    zIndex: 1000, // Ensure it stays above other content
    fontSize: '2rem',
    fontWeight: 'bold',
    color: '#61dafb',
    background: 'rgba(0, 0, 0, 0.8)', // Semi-transparent background
    padding: '15px',
    textAlign: 'center',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.5)',
  },
  list: {
    textAlign: 'left',
    margin: '20px auto',
    maxWidth: '600px',
    color: '#ddd',
  },
};

function FoodRecommendation() {
  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h2>Food Recommendations</h2>
      </header>
      <p>Based on your skin condition, here are some dietary recommendations:</p>
      <ul style={styles.list}>
        <li>Include more fruits and vegetables in your diet.</li>
        <li>Stay hydrated by drinking plenty of water.</li>
        <li>Avoid processed and sugary foods.</li>
        <li>Incorporate foods rich in omega-3 fatty acids, like fish and nuts.</li>
      </ul>
    </div>
  );
}

export default FoodRecommendation;
